import "./chart.css"
import { LineChart, Line, XAxis, CartesianGrid, Tooltip, ResponsiveContainer } from 'recharts';

export default function Chart(){

    const data = [
        {
          name: 'January',
          "Active User": 2000,
          
        },

        {
          name: 'February',
          "Active User": 2100,
          
        },
        {
            name: 'March',
            "Active User": 2300,
            
          },

          {
            name: 'April',
            "Active User": 2500,
            
          },

          {
            name: 'May',
            "Active User": 2600,
            
          },

          {
            name: 'June',
            "Active User": 2800,
            
          },

          {
            name: 'July',
            "Active User": 2920,
            
          },

          {
            name: 'September',
            "Active User": 2950,
            
          },

          {
            name: 'October',
            "Active User": 3000,
            
          },

          {
            name: 'November',
            "Active User": 3050,
            
          },

          {
            name: 'December',
            "Active User": 3100,
            
          },
  
  
      ];

  return (
    <div className="chart">
      <h3 className="chartTitle">User Analytics</h3>
      <ResponsiveContainer width="100%" aspect={4/ 1}>
          <LineChart data={data}>
              <XAxis dataKey="name" stroke="#5550bd"/>
              <Line type="monotone" dataKey="Active User" stroke="#5550bd"/>
              <Tooltip />
              <CartesianGrid stroke="#e0dfdf" strokeDasharray="5 5"/>
          </LineChart>
      </ResponsiveContainer>
    </div>
  )
}
